import React from 'react';

function Awards() {
    return ( 
        <div className='container mt-5'>
            <div  className='row'>
                <div className='col-md-6'>
                <img src='Media/Images/largestBroker.svg' alt='Awards Image'/>
                </div>
                <div className='col-md-6'>
                    <h1>Largest stock broker in India</h1>

                </div>
            </div>
        </div>
     );
}

export default Awards;
